import React, {Component} from 'react';

export interface ExpandableOptionProps {
    outline: string,
    description: string,
    readMore?: string,
}

interface State {
    open: boolean
}

class ExpandableOption extends Component<ExpandableOptionProps> {
    state: State = {
        open: false,
    };


    render() {
        const {outline, description} = this.props;

        return (
            <div>
                <h5>{outline}</h5>
            </div>
        );
    }
}


export default ExpandableOption
